  \"2016-07-27T22:57:00.110447\",\n\t\"name\": \"crescent-lake-north-platte-national-wildlife-refuge-complex-annual-narrative-report-calend-4b8a1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Crescent
  Lake and North Platte National Wildlife Refuge outlines Refuge accomplishments during
  the 1999 calendar year. The report begins with a summary of the year's highlights
  and climate conditions. Land acquisition is covered. The report includes a planning
  section which discusses management planning and research and investigations. Refuge
  administration is outlined; information about personnel, volunteer programs, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, grasslands, grazing, haying, fire management, pest control,
  water rights, and wilderness and special areas. The wildlife section of the report
  discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
  birds and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
  other resident wildlife, fisheries resources, and animal control. The public uses
  of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, wildlife observation, off-road vehicling, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, major maintenance, and equipment utilization and replacement. Cooperative
  programs are provided at the end. Photographs are attached.\",\n\t\"license_title\":
